import React from 'react';
import { connect } from 'react-redux';


class MyPage extends React.Component {
    constructor(props) {
        super(props)
        this.state={
            userDetails:[],
            position:[]
        }
    }

    render() { 
        const { userDetails } = this.props;
        console.log('mypage에 잘 들어왔나!    =', userDetails);
        const { position } = userDetails.position;
        return (
            <div>
                <p>이름 : {userDetails.username}<a href="/usereditlogin">회원 정보수정</a></p>
                <p>주소 : {position.customerAddr}</p>
                <p>전화번호 : {position.customerPhone}</p>
                <p>쿠폰 : {position.cutomerCoupon}</p>
                <p>가입일 : {userDetails.userRegDay}</p>
                <p>최근 접속일자 : {userDetails.userLastConnect}</p>
                <p>이메일 : {userDetails.userEmail}</p>
            </div>
        );
    }
}

function mapStateToProps(state) {
    const { auth } = state;
    const {userDetails}=auth;
    const {position}=userDetails;
    return {
        userDetails,
        position  // 배열...
    };
}
export default connect(mapStateToProps)(MyPage);
